myChart.setOption(option = makeOption());

function makeOption() {
    return {
        animation: false,
        grid: {
            show: true,
            top: 70,
            bottom: 20,
            left: 100,
            right: 20,
            backgroundColor: '#fff',
            borderWidth: 0
        },
        dataZoom: [{
            type: 'slider',
            yAxisIndex: 0,
            zoomLock: true,
            width: 10,
            right: 10,
            top: 70,
            bottom: 20,
            start: 20,
            end: 100,
            handleSize: 0,
            showDetail: false,
        }, {
            type: 'inside',
            id: 'insideY',
            yAxisIndex: 0,
            start: 20,
            end: 100,
            zoomOnMouseWheel: false,
            moveOnMouseMove: true,
            moveOnMouseWheel: true
        }],
        xAxis: {
            type: 'time',
            position: 'top',
            splitLine: {
                lineStyle: {
                    color: ['#E9EDFF']
                }
            },
            axisLine: {
                show: false
            },
            axisTick: {
                lineStyle: {
                    color: '#929ABA'
                }
            },
            axisLabel: {
                formatter: e=>{
                    date = new Date(e)
                    return (date.getMonth()+1) + "-" + date.getDate()
                },
                color: '#4d82ae',
                inside: false,
                align: 'center'
            }
        },
        yAxis: {
            axisTick: {
                show: false
            },
            splitLine: {
                show: false
            },
            axisLine: {
                show: false
            },
            axisLabel: {
                show: false
            },
            min: 0,
            max: trace_data.area.length
        },
        series: [{
            type: 'custom',
            renderItem: renderGanttItem,
            encode: {
                x: [ST_TIME],
                y: AREA_INDEX,
                tooltip: [AREA_INDEX, ST_TIME]
            },
            data: trace_data.data
        }, {
            type: 'custom',
            renderItem: renderAxisLabelItem,
            encode: {
                x: -1,
                y: 0
            },
            data: echarts.util.map(trace_data.area, function(item, index) {
                return [index].concat(item);
            })
        }]
    };
}

function renderGanttItem(params, api) {
    var categoryIndex = api.value(AREA_INDEX);
    var st_time = api.coord([api.value(ST_TIME), categoryIndex]);
    var end_time = api.coord([api.value(ST_TIME)+86400000, categoryIndex]);

    var barLength = end_time[0] - st_time[0];

    var barHeight = api.size([0, 1])[1] * HEIGHT_RATIO;
    var x = st_time[0];
    var y = st_time[1] - barHeight;

    var rectNormal = clipRectByRect(params, {
        x: x,
        y: y,
        width: barLength,
        height: barHeight
    });
    let color = ['rgba(127, 164, 196, 0.5)', 'rgba(195, 103, 104, 0.5)'] // 0 输出 1输入
    return {
        type: 'group',
        children: [{
            type: 'rect',
            shape: rectNormal,
            style: api.style({
                fill: color[api.value(1)]
            })
        }]
    };
}

function renderAxisLabelItem(params, api) {
    var y = api.coord([0, api.value(0)])[1];
    if (y < params.coordSys.y + 5) {
        return;
    }
    return {
        type: 'group',
        position: [
            10,
            y
        ],
        children: [{
            type: 'text',
            style: {
                x: 40,
                y: -3,
                text: api.value(1),
                textVerticalAlign: 'middle',
                textAlign: 'center',
                textFill: '#000'
            }
        }]
    };
}

function clipRectByRect(params, rect) {
    return echarts.graphic.clipRectByRect(rect, {
        x: params.coordSys.x,
        y: params.coordSys.y,
        width: params.coordSys.width,
        height: params.coordSys.height
    });
}